import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from './serviceWorker';
import {Form} from './components/index';

const forminit = {
    id: '',
    class: 'classname',
    method: 'post',
    action: '',
    inputs: [
        {name: 'name', value: '', default: '',},
        {name: 'work', type: 'textarea', value: '2018',},
        {name: 'select', type: 'select', default: '2',
            opts: [
                {desc: '0', disable: true},
                {desc: '1', value: '1'},
                {desc: '2', value: '2'},
            ],
        },
    ],
    children: (<a>这是一个链接</a>),
};


function submit(e){
    alert('233');
    console.log(e.map);
}

function change(e){
    setTimeout(function () {
        e.innerHTML = 889;
    },1000);
    console.log(e.target);
}

ReactDOM.render(<Form forminit={forminit} submit={submit} change={change}/>, document.getElementById('app'));

serviceWorker.unregister();
